import React from 'react'
import './App.css';
import Navbar from './components/navbar/Navbar';
import Banner from './components/Banner/Banner';
import RowPost from './components/RowPost/RowPost';
import { Top_Rated,Upcoming,Now_Playing,Popular, TV_Shows, on_the_air, Tv_popular, Tv_top_rated } from './urls/url';


function App() {
  return (
    <div className="App">
      <Navbar />
      <Banner />
      <RowPost url={Top_Rated} title={'Netflix Originals'} />
      <RowPost url={Now_Playing} title={'Action'} isSmall/>
      <RowPost url={Upcoming} title={'Upcoming'} isSmall/>
      <RowPost url={Popular} title={'Popular'} isSmall/>
      <RowPost url={TV_Shows} title={'TV Shows'} isSmall/>
      <RowPost url={on_the_air} title={'On The Air'} isSmall/>
      <RowPost url={Tv_popular} title={'Popular'} isSmall/>
      <RowPost url={Tv_top_rated} title={'Top Rr'} isSmall/>
    </div>
  );
}

export default App;
